function Portfolio({ imageLinks }) {
    return (
        <>
            {imageLinks.map((link, index) => (
                <div key={index} className="col-md-4">
                    <img src={link}  className="img-fluid rounded portfolio-image" style={{ width:"500px", height: "300px", objectFit: "cover" }} />
                </div>
            ))}
        </>
    );
}

export default Portfolio;
